sys_ui_script.script:
angular.module('sn.$sp')
    .constant("tabbedConfig", (typeof tabbedConfig != "undefined") ? tabbedConfig : gblTabbedConfig || {})
    .config(function($provide, tabbedConfigProvider) {
        $provide.decorator('spModelDirective', function($delegate) {
            if ((tabbedConfigProvider.enableCatalog || false) == true)
                $delegate[0].templateUrl = "tabbed_form_template_v2";
            return $delegate;
        });
    });
